import React from "react";
import PropTypes from "prop-types";

function Food({ name, picture, rating }) {
  return (
    <div>
      <h3>I love {name}</h3>
      <h2>{rating}/5.0</h2>
      <img src={picture} alt={name} />
    </div>
  );
}

Food.propTypes = {
  name: PropTypes.string.isRequired,
  picture: PropTypes.string.isRequired,
  rating: PropTypes.number.isRequired
}

const foodILike = [
{
  id:1, 
  name: "Kimchi", 
  picture: "http://aeriskitchen.com/wp-content/uploads/2008/09/kimchi_bokkeumbap_02-.jpg",
  rating: 5 
},
{
  id:2,
  name: "bulgogi", 
  picture: "data:image/jpeg;base64,",
  rating: 4.9
},
{
  id:3, 
  name: "kimbap", 
  picture: "data:image/jpeg;base64,",
  rating: 5.5
},
{
  id:4, 
  name: "Doncasu", 
  picture: "https://s3-media3.fl.yelpcdn.com/bphoto/7F9eTTQ_yxaWIRytAu5feA/ls.jpg",
  rating: 4.7
}
];

function App() {
  return ( 
  <div> 
    {foodILike.map(dish => (
      <Food key={dish.id} name={dish.name} picture={dish.picture} rating={dish.rating} />
    ))}
  </div>
  );
}

export default App;
